criteria.textblock:
        Inclusion Criteria:

          -  Female aged between 18 and 45 years at the first vaccination;

          -  Be able to understand and comply with the request of the protocol, and sign written
             informed consent;

          -  Be able to read, understand and complete diary card;

          -  According to the medical history and the results of physical examination and
             laboratory examination, the subjects were judged to be in good health

          -  Women who agree to use effective contraception throughout the study period；

        Exclusion Criteria:

        Exclusion criteria of first injection

          -  History of HPV positive；

          -  History of drug abuse, alcohol abuse or dependence in the last year；

          -  History of severe allergy (e.g., anaphylaxis and other significant reaction) to any
             previous vaccines, or allergy to any of the components of investigational vaccine；

          -  People with low immune function may be diagnosed with congenital or acquired
             immunodeficiency, HIV infection, lymphoma, tuberculosis, leukemia, systemic lupus
             erythematosus, rheumatoid arthritis, inflammatory bowel disease or other autoimmune
             conditions；

          -  People whose spleen has been removed；

          -  People received the following immunosuppressive therapy in the past year:
             radiotherapy, cyclophosphamide, imidazolidine, methotrexate, chemotherapy,
             cyclosporine, leflunomide, tumor necrosis factor- α Antagonists, monoclonal antibody
             therapy, intravenous immunoglobulin, anti lymphocyte serum, or other known therapies
             that interfere with immunity;

          -  People are receiving systemic corticosteroid therapy, or received two or more courses
             of high-dose corticosteroids for one week one year before enrollment (nasal inhaled
             corticosteroids or topical corticosteroids can not be excluded);

          -  People receiving any immunoglobulin products or blood products within the first 3
             months, or planning to receive similar products during the study period;

          -  Inactivated vaccine was inoculated 14 days before inoculation or attenuated vaccine
             was inoculated 28 days before inoculation;

          -  Contraindications of intramuscular injection such as thrombocytopenia or other
             coagulation disorders;

          -  Blood donation within the first week or planned during the study period;

          -  Egg donation was planned during the study period;

          -  Participating in other experimental clinical studies;

          -  Have been vaccinated with HPV vaccine on the market or have participated in clinical
             trials of HPV vaccine;

          -  Failure to comply with the test procedures or planned relocation during the study;

          -  Fever occurred within 24 hours before inoculation (axillary temperature > 37 ℃);

          -  Pregnant women (blood pregnancy test or urine pregnancy test positive) or lactating
             women;

          -  There is clinical evidence of purulent cervicitis;

          -  Having serious cardiovascular diseases, such as arrhythmia, conduction block,
             myocardial infarction, severe hypertension, diabetes and drug uncontrollable;

          -  Acute infection;

          -  Other abnormalities, which may confuse the results of the study, or which are not in
             line with the maximization of the interests of the subjects, can be excluded by the
             judgment of the investigators.

        Exclusion criteria for 2nd or 3rd dose vaccination

          -  having severe allergic reaction during the first or second dose of vaccination and
             cannot continue to be vaccinated according to the judgment of investigators;

          -  The serious adverse reactions with the previous vaccination were related, and the
             investigators judged that they could not continue to be vaccinated;

          -  After the first vaccination, the newly discovered or newly occurred serious medical
             diseases, coagulation dysfunction, etc. can not continue to be vaccinated according to
             the judgment of the investigators;
